    <script> var  description =  [{"id":"barnediabetes_dg","dg_id":null,"include":1,"title":"Dekningsgrad - Andel pasienter som har fått utført årskontroll","name":"KiA","type":"andel","level_green":0.95,"level_yellow":0.8,"level_direction":1,"short_description":"Dekningsgrad på årskontroll beregnes ut fra ifra antall pasienter registrert i BDR som har tatt årskontroll og avdelingens egen pasientoversikt over hvem som skal ta årskontroll.","long_description":"Dekningsgrad på årskontroll beregnes ut fra ifra antall pasienter registrert i BDR som har tatt årskontroll og avdelingens egen pasientoversikt over hvem som skal ta årskontroll.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_hba1c_ge_9","dg_id":null,"include":1,"title":"HbA1c ≥ 9,0 %","name":"KiE","type":"andel","level_green":0.05,"level_yellow":0.1,"level_direction":0,"short_description":"Andel pasienter med HbA1c > 9,0","long_description":"Andel pasienter med HbA1c > 9,0","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_hba1c_lt_7","dg_id":null,"include":1,"title":"HbA1c < 7,0 %","name":"KiC","type":"andel","level_green":0.4,"level_yellow":0.2,"level_direction":1,"short_description":"Andel pasienter med HbA1c < 7,0 %","long_description":"Andel pasienter med HbA1c < 7,0 %","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_hba1c_lt_7.5","dg_id":null,"include":1,"title":"HbA1c < 7,5 %","name":"KiD","type":"andel","level_green":0.6,"level_yellow":0.4,"level_direction":1,"short_description":"Andel pasienter med HbA1c < 7,5 %","long_description":"Andel pasienter med HbA1c < 7,5 %","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_ikke_innlagt_dka","dg_id":null,"include":1,"title":"Andel som ikke har vært innlagt med DKA","name":"KiM","type":"andel","level_green":0.97,"level_yellow":0.95,"level_direction":1,"short_description":"Diabetes ketoacidose (DKA)","long_description":"Diabetes ketoacidose (DKA)","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_ikke_sjokk","dg_id":null,"include":1,"title":"Andel som ikke har hatt insulinsjokk","name":"KiN","type":"andel","level_green":0.97,"level_yellow":0.95,"level_direction":1,"short_description":"Insulinsjokk er alvorlig lavt blodsukker med bevistløshet","long_description":"Insulinsjokk er alvorlig lavt blodsukker med bevistløshet","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_maalt_bt","dg_id":null,"include":1,"title":"Andel som har målt BT","name":"KiI","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Forhøyet BT er en egen risikofaktor for utvikling av hjertekarsykdom. Dette er en risikofaktor som kan endres ved livsstilsendringer.","long_description":"Forhøyet BT er en egen risikofaktor for utvikling av hjertekarsykdom. Dette er en risikofaktor som kan endres ved livsstilsendringer.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_maalt_coliaki","dg_id":null,"include":1,"title":"Andel som har målt cøliakiantistoffer","name":"KiL","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Både cøliaki, hypothyreose og hypothyreose opptrer oftere hos pasienter med type 1 diabetes.","long_description":"Både cøliaki, hypothyreose og hypothyreose opptrer oftere hos pasienter med type 1 diabetes. Cøliaki og hypothyreose kan ha lite / diffuse symptomer. Begge sykdommer trenger behandling.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_maalt_hba1c","dg_id":null,"include":1,"title":"Andel målt HbA1c","name":"KiB","type":"andel","level_green":0.95,"level_yellow":0.8,"level_direction":1,"short_description":"HbA1c reflekterer blodsukkernivå siste 4-12 uker.","long_description":"HbA1c reflekterer blodsukkernivå siste 4-12 uker. HbA1c vurderes å være det beste målet på blodsukkerkontroll og den eneste variabelen per i dag som kan relateres til senere utvikling av mikrovaskulære komplikasjoner (øyeskade, nyreskade, nerveskade) og makrovaskulære komplikasjoner (hjertesykdom, slag, amputasjoner).","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_maalt_lipider","dg_id":null,"include":1,"title":"Andel som har målt lipider","name":"KiH","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Dyslipidemi er en egen risikofaktor for hjertekarsykdom. Dette er en risikofaktor som kan bedres ved livsstilsendringer.Forhøyet BT er en egen risikofaktor for utvikling av hjertekarsykdom.","long_description":"Dyslipidemi er en egen risikofaktor for hjertekarsykdom. Dette er en risikofaktor som kan bedres ved livsstilsendringer.Forhøyet BT er en egen risikofaktor for utvikling av hjertekarsykdom. Dette er en risikofaktor som kan bedres ved livsstilsendringer.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_maalt_tsh","dg_id":null,"include":1,"title":"Andel som har målt TSH","name":"KiK","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Screening for hypothyreose","long_description":"Screening for hypothyreose","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_oyeundersok_ispad","dg_id":null,"include":1,"title":"Andel pasienter tatt øyelegeundersøkelse iht. ISPAD","name":"KiG","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Utviklingen av diabetesretinopati kan bremses / stanses med riktig behandling.","long_description":"Utviklingen av diabetesretinopati kan bremses / stanses med riktig behandling.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_urinprove_ispad","dg_id":null,"include":1,"title":"Andel pasienter tatt urinprøve iht. ISPAD","name":"KiF","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Diabetesnefropati starter med persisterende mikroalbuminuri. Denne utviklingen kan bremses / stanses med riktig behandling","long_description":"Diabetesnefropati starter med persisterende mikroalbuminuri. Denne utviklingen kan bremses / stanses med riktig behandling","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"barnediabetes_vurdert_infiltrater","dg_id":null,"include":1,"title":"Andel som er vurdert for infiltrater","name":"KiJ","type":"andel","level_green":0.9,"level_yellow":0.7,"level_direction":1,"short_description":"Infiltrater (fortykket fettvev) gir nedsatt effekt av insulin. Pasientene må få råd om hvordan unngå dette.","long_description":"Infiltrater (fortykket fettvev) gir nedsatt effekt av insulin. Pasientene må få råd om hvordan unngå dette.","registry_id":27,"rname":"barnediabetes","full_name":"Nasjonalt medisinsk kvalitetsregister for barne- og ungdomsdiabetes"},{"id":"hjerteinfarkt_ace_aiiantag_ind","dg_id":"hjerteinfarkt_dg","include":1,"title":"ACE-hemmer/AII-antagonist hvis indikasjon","name":"kiK","type":"andel","level_green":0.8,"level_yellow":0.7,"level_direction":1,"short_description":"Pasienter under 85 år med hjertesvikt eller sukkersyke som fikk anbefalt medisin (ACE/AII hemmer)","long_description":"Kvalitetsindikatoren er definert som andel pasienter under 85 år med hjertesvikt eller sukkersyke som fikk medikament ACE-hemmer eller AII-antagonist. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasientene med EF <40 %, eller som har hjertesvikt i tidligere sykehistorie, eller som fikk hjertesvikt som komplikasjon i behandlingskjeden, eller som har sukkersyke, som hovedregel behandles med ACE-hemmer/AII-antagonist. Hos noen pasienter vil det være medisinsk korrekt å fravike anbefalingene. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_dg","dg_id":null,"include":0,"title":"Dekningsgrad","name":"kiA","type":"andel","level_green":0.85,"level_yellow":0.7,"level_direction":1,"short_description":"Hvor stor andel av pasienter med hjerteinfarkt som sykehuset meldte til  Norsk hjerteinfarktregister","long_description":"God dekningsgrad er en forutsetning for å vurdere kvaliteten på hjerteinfarktbehandlingen ved det enkelte sykehus. Ved registrering må sykehusene rapportere hvem de behandler, hvordan de behandler og hva som oppnås ved behandlingen. På den måten blir registrering av alle hjerteinfarkt ved et sykehus et nødvendig og viktig verktøy for kvalitetsforbedring, og en forutsetning for å kunne bedømme alle de andre kvalitetsindikatorene.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_ef_maalt","dg_id":"hjerteinfarkt_dg","include":1,"title":"Ejeksjonsfraksjon (EF) målt","name":"kiH","type":"andel","level_green":0.8,"level_yellow":0.6,"level_direction":1,"short_description":"Undersøkelse av hjertets pumpefunksjon med ultralyd","long_description":"Kvalitetsindikatoren er definert som andel pasienter som undersøkes med måling av hjertets pumpefunksjon. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at ejeksjonsfraksjon (hjertets pumpefunksjon) som hovedregel blir beskrevet og målt under sykdomsforløpet. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_invasivt_nstemi","dg_id":"hjerteinfarkt_dg","include":1,"title":"Invasivt utredet ved NSTEMI","name":"kiD","type":"andel","level_green":0.85,"level_yellow":0.7,"level_direction":1,"short_description":"Pasienter under 85 år med mindre EKG-forandringer som ble undersøkt med røntgen av hjertets blodårer i løpet av behandlingsforløpet","long_description":"Kvalitetsindikatoren er definert som andel av pasienter under 85 med mindre EKG-forandringer som ble undersøkt med røntgen av hjertets blodårer i løpet av behandlingskjeden. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasienter med NSTEMI som hovedregel utredes invasivt med koronar angiografi under sykehusoppholdet. Ved invasiv utredning kartlegges sykdomsutbredelse. Dette er av betydning for risikostratifisering og planlegging av behandlingen. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_invasivt_nstemi_72t","dg_id":"hjerteinfarkt_dg","include":1,"title":"Invasivt utredet innen 72 timer ved NSTEMI","name":"kiE","type":"andel","level_green":0.8,"level_yellow":0.5,"level_direction":1,"short_description":"Pasienter under 85 år med mindre EKG-forandringer som ble undersøkt med røntgen av hjertets blodårer innen 72 timer etter innleggelse","long_description":"Kvalitetsindikatoren er definert som andel pasienter under 85 år med mindre EKG-forandringer som ble undersøkt med røntgen av hjertets blodårer innen 72 timer etter innleggelse. Europeiske retningslinjer anbefaler at pasienter med NSTEMI som hovedregel gjennomgår invasiv utredning innen 24 timer etter innleggelse. Praksis varierer i Norge. Fagrådet for Norsk hjerteinfarktregister har vurdert foreliggende data og funnet at det ikke foreligger god dokumentasjon for at pasienter med NSTEMI som hovedregel bør utredes innen 24 timer. Fagrådet har derfor valgt å opprettholde utredning innen 72 timer etter innleggelse som nasjonal kvalitetsindikator. Det understrekes at pasientene må risikostratifiseres, og at pasienter med høy risiko må utredes raskt og noen umiddelbart (innen 2 timer). Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_pci_tid","dg_id":"hjerteinfarkt_dg","include":1,"title":"Primær PCI innen anbefalt tid","name":"kiC2","type":"andel","level_green":0.85,"level_yellow":0.7,"level_direction":1,"short_description":"Pasienter under 85 år som i løpet av kort tid ble behandlet med utblokking (PCI)  ved mistanke om tett hjerteåre","long_description":"Andel pasienter under 85 år med STEMI og <12 timer fra symptomdebut til første medisinske kontakt som fikk primær PCI innen 120 minutter etter første medisinske kontakt. Primær PCI er definert som angiografi eller PCI som initial metode for å oppnå reperfusjon når angiografi eller PCI ble utført innen 12 timer etter første medisinske kontakt og det ikke var gitt trombolyse på forhånd. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasienter som har alvorlig hjerteinfarkt med tett hjerteåre får behandling med utblokking (PCI) innen 120 minutter. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_reper_stemi","dg_id":"hjerteinfarkt_dg","include":1,"title":"Reperfusjonsbehandling ved STEMI","name":"kiB","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Pasienter under 85 år som ble behandlet med blodpropp-løsende medisin eller utblokking ved mistanke om tett hjerteåre","long_description":"Denne kvalitetsindikatoren er definert som andel pasienter under 85 år som ble behandlet med blodproppløsende medikament eller utblokking ved alvorlig hjerteinfarkt (STEMI). De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasienter med ST-elevasjonsinfarkt (STEMI) og med <12 timer fra symptomdebut til første medisinske kontakt (FMK) blir behandlet med trombolyse og/eller koronar angiografi/PCI i sykdomsforløpet. Hos noen pasienter vil det være medisinsk korrekt å fravike anbefalingene. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_reper_stemi_tid","dg_id":"hjerteinfarkt_dg","include":1,"title":"Reperfusjonsbehandling innen anbefalt tid ved STEMI","name":"kiC","type":"andel","level_green":0.85,"level_yellow":0.7,"level_direction":1,"short_description":"Pasienter under 85 år som  i løpet av kort tid ble behandlet med blodpropp-løsende medisin eller utblokking  ved mistanke om tett hjerteåre","long_description":"Kvalitetsindikatoren er definert som andel av pasienter under 85 år som innen anbefalt tid ble behandlet med blodproppløsende medikament eller utblokking ved mistanke om tett hjerteåre og alvorlig hjerteinfarkt (STEMI). Andel pasienter under 85 år innlagt med STelevasjonsinfarkt (STEMI) og med <12 timer fra symptomdebut til første medisinske kontakt som ble behandlet med trombolyse innen 30 minutter eller koronar angiografi/PCI innen 120 minutter etter første medisinske kontakt. Ved STEMI skal den tette blodåren åpnes så raskt som overhode mulig. Dette vil gi redusert myokardskade og redusert risiko for hjertesvikt og død. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_tromb_tid","dg_id":"hjerteinfarkt_dg","include":1,"title":"Trombolyse innen anbefalt tid","name":"kiC1","type":"andel","level_green":0.8,"level_yellow":0.5,"level_direction":1,"short_description":"Pasienter under 85 år som  i løpet av kort tid ble behandlet med blodpropp-løsende medisin ved mistanke om tett hjerteåre","long_description":"Kvalitetsindikatoren er definert som andel pasienter under 85 år med STEMI som fikk trombolyse innen 30 minutter av de som ble behandlet med trombolyse som initial reperfusjonsmetode. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasienter som har alvorlig hjerteinfarkt med tett hjerteåre får blodproppløsende medikament innen 30 minutter hvis pasienten ikke kan behandles med utblokking (PCI) innen 120 minutter. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_ut_antitromb","dg_id":"hjerteinfarkt_dg","include":1,"title":"Utskrevet med antitrombotisk behandling","name":"kiF","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Pasienter under 85 år som behandles med to medikament for å forebygge ny blodpropp etter hjerteinfarktet","long_description":"Kvalitetsindikatoren er definert som andel av pasienter under 85 år som behandles med to platehemmende medikament eller et platehemmende medikament og et antikoagulasjonsbehandlende medikament etter hjerteinfarktet. Antitrombotisk behandling gir prognostisk gevinst. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasientene som hovedregel behandles i 12 måneder med to medikament for å hindre blodpropp etter hjerteinfarktet. Hos noen pasienter vil det være medisinsk korrekt å fravike anbefalingene. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_ut_betablokk_ind","dg_id":"hjerteinfarkt_dg","include":1,"title":"Utskrevet med betablokker hvis indikasjon","name":"kiJ","type":"andel","level_green":0.85,"level_yellow":0.75,"level_direction":1,"short_description":"Pasienter under 85 år som fikk anbefalt  medisin (betablokker) for å stabilisere hjerterytmen","long_description":"Kvalitetsindikatoren er definert som andel pasienter under 85 år som fikk anbefalt betablokker medikament hvis det var indikasjon for betablokker. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasientene med EF <40 %, eller som hadde hjertesvikt i tidligere sykehistorie eller som fikk hjertesvikt i behandlingskjeden som hovedregel bør behandles med betablokker. Hos noen pasienter vil det være medisinsk korrekt å fravike anbefalingene. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hjerteinfarkt_ut_lipidsenk","dg_id":"hjerteinfarkt_dg","include":1,"title":"Utskrevet med lipidsenkende medikament","name":"kiG","type":"andel","level_green":0.9,"level_yellow":0.85,"level_direction":1,"short_description":"Pasienter under 85 år som behandles med kolesterolsenkende medisin etter hjerteinfarktet","long_description":"Kvalitetsindikatoren er definert som andel pasienter under 85 år som behandles med kolesterolsenkende medikament etter hjerteinfarktet. Kolesterolsenkende behandling gir prognostisk gevinst. De europeiske retningslinjene som Norsk cardiologisk selskap har sluttet seg til, anbefaler at pasientene som hovedregel behandles med lipidsenkende medikament på ubestemt tid. Høyt målnivå er ønskelig.","registry_id":2,"rname":"hjerteinfarkt","full_name":"Norsk hjerteinfarktregister"},{"id":"hoftebrudd_1aar","dg_id":null,"include":1,"title":"Ikke-reopererte proteser innen et år","name":"Ind1aar","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"En reoperasjon er en betydelig belastning for en hoftebruddpasient og andelen reoperasjon er derfor et viktig mål for kvaliteten av behandlingen","long_description":"Andelen reoperasjoner er et mål på kvaliteten av behandlingen. En reoperasjon kan være en betydelig belastning for hoftebruddpasientene og medfører både øket mortalitet og morbiditet. Pasientene har i perioden før en reoperasjon oftest smerter og økte problemer i det daglige. Et viktig mål for behandling av hoftebrudd er derfor å unngå reoperasjoner. De fleste reoperasjoner for hoftebrudd skjer i løpet av det første året etter primæroperasjonen.|Andelen reoperasjoner innen 1 år postoperativt må imidlertid sees i sammenheng med rapporteringsgraden av reoperasjoner. Dersom rapportering av reoperasjoner er dårlig ved et sykehus vil dette medføre en falsk lav andel reopererte pasienter. Andelen reoperasjoner kan også ses i sammenheng med behandlingsmetode (kvalitetsindikatorer  for protese ved dislokerte lårhalsbrudd og sementert stamme ved bruk av protese).|De fleste sykehus har mindre enn 10 % reoperasjoner første året etter primæroperasjon og oppnår dermed god måloppnåelse.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_24t","dg_id":null,"include":1,"title":"Operasjon innen 24 timer (tilstrebes)","name":"Ind24t","type":"andel","level_green":0.8,"level_yellow":0.6,"level_direction":1,"short_description":"Det er gode holdepunkter for at hoftebrudd bør opereres innen 24 timer etter bruddtidspunktet","long_description":"Denne kvalitetsindikatoren er definert som andel pasienter med akutt hoftebrudd som ble operert innen 24 timer etter bruddtidspunktet. Det er gode holdepunkter for å anbefale at alle hoftebrudd bør tilstrebes operert innen 24 timer og senest innen 48 timer. Vi har definert >90 % som svært god måloppnåelse og >80 % som god måloppnåelse for operasjon innen 48 timer. For operasjon innen 24 timer er >80 % definert som svært god måloppnåelse og >60 % som god måloppnåelse. Foreløpig vil tid fra brudd til operasjon bli brukt som ventetid. Det jobbes med å innhente innleggelsestidspunkt i sykehus. Ventetid fra innleggelse til operasjon kan kanskje være en mer riktig prosessindikator. På landsbasis er det meget god måloppnåelse, men det er store variasjoner mellom de enkelte sykehusene. Det er en tendens til at de store universitetssykehusene har større problemer med å få operert pasientene innen de anbefalte 48 timer.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_30d_doed","dg_id":null,"include":1,"title":"30 dagers overlevelse","name":"Ind30dDod","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"30 dagers overlevelse er en hyppig brukt resultatindikator for behandling av hoftebrudd","long_description":"30 dagers overlevelse er en hyppig brukt resultatindikator for behandling av hoftebrudd. Det er imidlertid mange ulike faktorer som kan påvirke overlevelsen og som det er umulig å korrigere godt for. 30 dagers overlevelse er selvsagt også avhengig av hendelser etter at pasienten er utskrevet fra sykehuset. Tilfeldigheter eller små forskjeller vil kunne se store ut når sykehusvise resultater sammenlignes.|30 dagers overlevelse er ved de fleste sykehus >90 %.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_48t","dg_id":null,"include":1,"title":"Operasjon innen 48 timer","name":"Ind48t","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Alle hoftebrudd bør senest opereres innen 48 timer etter bruddtidspunktet for å redusere dødelighet og fare for medisinske komplikasjoner","long_description":"Denne kvalitetsindikatoren er definert som andel pasienter med akutt hoftebrudd som ble operert innen 48 timer etter bruddtidspunktet.|Det er gode holdepunkter for å anbefale at alle hoftebrudd bør tilstrebes operert innen 24 timer og senest innen 48 timer. Vi har definert >90 % som svært god måloppnåelse og >80 % som god måloppnåelse for operasjon innen 48 timer. For operasjon innen 24 timer er >80 % definert som svært god måloppnåelse og >60 % som god måloppnåelse.|Foreløpig vil tid fra brudd til operasjon bli brukt som ventetid. Det jobbes med å innhente innleggelsestidspunkt i sykehus. Ventetid fra innleggelse til operasjon kan kanskje være en mer riktig prosessindikator.|På landsbasis er det meget god måloppnåelse, men det er store variasjoner mellom de enkelte sykehusene. Det er en tendens til at de store universitetssykehusene har større problemer med å få operert pasientene innen de anbefalte 48 timer.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_dg_prim_brudd","dg_id":null,"include":0,"title":"Dekningsgrad av primære hoftebrudd","name":"IndDGp","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Dekningsgrad gir et mål på hvor stor andel av primære hoftebruddsoperasjoner som blir meldt til registeret sammenlignet med Norsk pasientregister","long_description":"Dekningsgrad for Norsk Hoftebruddregister (NHBR) er definert som andelen av de pasienter som sykehuset rapporterte til Norsk pasientregister (NPR) som sykehuset også meldte til NHBR. Vi har definert >90 % som svært god måloppnåelse, >80 % som god måloppnåelse.|En del usikkerhet er knyttet til beregning av dekningsgrad. Det er viktig at sykehusene rapporterer riktige diagnosekoder og prosedyrekoder til NPR for at riktige operasjoner skal bli koblet til NHBR. For primæroperasjoner er dette mindre problematisk, men for reoperasjoner er det en større usikkerhet da flere ulike prosedyrekoder kan benyttes. Det finnes ingen klare retningslinjer for hvilke prosedyrekoder som kirurgene skal benytte ved for eksempel bløtdelsrevisjoner etter infeksjon.|NPR mangler spesifisering av legemsside og dette medfører en usikkerhet i analysene. Totalproteser i hofte implanteres også av andre årsaker enn hoftebrudd. Pasienter kan ha totalproteser i begge hofter og en kan ut fra data i NPR ikke avgjøre hvilken protese som er reoperert. Dersom totalprotesen som er reoperert ikke er implantert som følge av hoftebrudd skal reoperasjonen heller ikke være registrert i NHBR. Det totale antallet reopererte totalproteser i NPR er altså høyere enn antallet reopererte totalproteser implantert etter hoftebrudd. Dette vil gi en feilaktig lavere dekningsgrad for totalproteser i NHBR.|Dekningsgradsanalyser var sist utført for operasjoner utført i perioden 2017-2018.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_dg_prim_hemi","dg_id":null,"include":0,"title":"Dekningsgrad primær hemiprotese","name":"IndDGph","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Dekningsgrad gir et mål på hvor stor andel av primære hemiproteser som blir meldt til registeret sammenlignet med Norsk pasientregister","long_description":"Dekningsgrad for Norsk Hoftebruddregister (NHBR) er definert som andelen av de pasienter som sykehuset rapporterte til Norsk pasientregister (NPR) som sykehuset også meldte til NHBR. Vi har definert >90 % som svært god måloppnåelse, >80 % som god måloppnåelse.|En del usikkerhet er knyttet til beregning av dekningsgrad. Det er viktig at sykehusene rapporterer riktige diagnosekoder og prosedyrekoder til NPR for at riktige operasjoner skal bli koblet til NHBR. For primæroperasjoner er dette mindre problematisk, men for reoperasjoner er det en større usikkerhet da flere ulike prosedyrekoder kan benyttes. Det finnes ingen klare retningslinjer for hvilke prosedyrekoder som kirurgene skal benytte ved for eksempel bløtdelsrevisjoner etter infeksjon.|NPR mangler spesifisering av legemsside og dette medfører en usikkerhet i analysene. Totalproteser i hofte implanteres også av andre årsaker enn hoftebrudd. Pasienter kan ha totalproteser i begge hofter og en kan ut fra data i NPR ikke avgjøre hvilken protese som er reoperert. Dersom totalprotesen som er reoperert ikke er implantert som følge av hoftebrudd skal reoperasjonen heller ikke være registrert i NHBR. Det totale antallet reopererte totalproteser i NPR er altså høyere enn antalle dregister"},{"id":"hoftebrudd_protese","dg_id":null,"include":1,"title":"Protese ved dislokerte lårhalsbrudd","name":"Indprotese","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Lårhalsbrudd hos pasienter over 70 år som er dislokerte (ute av stilling) bør opereres med en protese for å redusere risiko for reoperasjon og for å bedre funksjon","long_description":"Det er gode holdepunkter for å kunne si at dislokerte lårhalsbrudd hos pasienter over 70 år bør opereres med protese. Protesevalg (hemiprotese eller totalprotese) bør avgjøres utfra pasientens biologiske alder og funksjonelle krav. Indikatoren viser andel av pasienter med dislokerte lårhalsbrudd over 70 år som er operert med protese.|I 2017 oppnådde alle sykehus i Norge god måloppnåelse og nesten alle sykehus meget god måloppnåelse på denne indikatoren.","registry_id":3,"rname":"hoftebrudd","full_name":"Nasjonalt hoftebruddregister"},{"id":"hoftebrudd_sement","dg_id":null,"include":1,"title":"Sementert stamme ved bruk av protese","name":"Indsement","type":"andel","level_green":0.9,"level_yellow":0.8,"level_direction":1,"short_description":"Alle hoftebruddpasienter over 70 år som skal opereres med en protese bør få lårbensprotesen sementert for å redusere risiko for reoperasjon","long_description":"Det er god dokumentasjon for å si at det ved hoftebruddpasienter over 70 år bør benyttes sementerte stammer. Bruk av usementerte stammer reduserer risiko for nye brudd rundt implantatene og dermed fare for reoperasjoner. Det har vært en viss bekymring for økt dødelighet grunnet sement implantasjons syndrom ved bruk av sementerte stammer, men flere studier viser nå at det kun foreligger en marginal økning i dødelighet selve operasjonsdagen og dagen etter operasjonen. Risiko er høyest for de skrøpeligste pasientene (ASA 3-5). Med godt samarbeid mellom kirurg og anestesilege kan dødeligheten reduseres.|De fleste sykehus i Norge i dag bruker sementerte stammer ved protese for
